import React from 'react'
import { useNavigate } from 'react-router-dom'

const Invitation = () => {
    const navigate = useNavigate();
    return (
        <div>
            <button onClick={() => navigate('/')}>Cancel Invitation and Go back </button>
        </div>
    )
}

export default Invitation
